Heartless (2009)  

Verenigd Koninkrijk
Drama / Thriller
114 minuten

geregisseerd door Philip Ridley
met Jim Sturgess, Joseph Mawle en Noel Clarke

Een jongeman sluit een deal met de duivel, waarna hij het door hem zo begeerde knappe uiterlijk krijgt. Maar zijn nieuwe looks blijken een schaduwkant te hebben en maken een moordenaar van hem.


